import React from "react";
import Footer from "../parts/Footer";
import Navbar from "../parts/Navbar";
import TeamHead from "../parts/TeamHead";
import Team from "../parts/Team";

const Join = () => {
  return (
    <>
      <Navbar />
      <TeamHead />
      <Team />
      <Footer />
    </>
  );
};

export default Join;
